window.bookSummaryJSON = "<p><i>The Lost Ranger</i>: Alex discovers he has been dropped in the middle of an ancient struggle for power, in a land where magic replaces science. If he can survive the near future, he has the potential to become a great wizard, feared by the very people he needs to protect.</p> <p><i>Dragon's Teeth</i>: As the newly appointed Lord Protector for Windfall and Mage Apprentice to the Wizard King of Great Vale, Alex Rogers had taken the role of a lifetime. Combined with his pending marriage to the half-nymph Lady Cassandra, he had more on his plate than he could ever hope to accomplish anytime soon.</p> <p><i>The Dark Paladin</i>: After vanquishing Tantalus and freeing the dragons, newly married Alex Rogers was looking forward to some time alone with Cassie, his wife. The two even talked of a little getaway for a honeymoon before he returned to his duties as Lord Protector of Windfall. Unfortunately, the forests and cities of his old home was not the destination he hoped for.</p>"; 
